class Solution {
  bool isGood(List<int> nums) {
    int n = nums.reduce((a, b) => a > b ? a : b); // Find the maximum element in nums
    if (nums.length != n + 1) return false; // Check if the length of nums is n + 1

    List<int> count = List.filled(n + 1, 0); // Initialize a list to count occurrences of each number
    for (int num in nums) {
      if (num > n) return false; // If any number is greater than n, return false
      count[num]++;
    }

    // Check if each number from 1 to n-1 appears exactly once and n appears exactly twice
    for (int i = 1; i <= n; i++) {
      if (i < n && count[i] != 1) return false;
      if (i == n && count[i] != 2) return false;
    }

    return true;
  }
}
